import{_ as o,c as t,o as i,aA as a}from"./chunks/framework.CHSKrKFr.js";const u=JSON.parse('{"title":"PySRRegressor Reference","description":"","frontmatter":{},"headers":[],"relativePath":"_api.md","filePath":"_api.md","lastUpdated":1759973160000}'),s={name:"_api.md"};function n(r,e,p,l,c,d){return i(),t("div",null,[...e[0]||(e[0]=[a(`<h1 id="pysrregressor-reference" tabindex="-1">PySRRegressor Reference <a class="header-anchor" href="#pysrregressor-reference" aria-label="Permalink to &quot;PySRRegressor Reference&quot;">​</a></h1><p><code>PySRRegressor</code> has many options for controlling a symbolic regression search. Let&#39;s look at them below.</p><h2 id="pysrregressor-parameters" tabindex="-1">PySRRegressor Parameters <a class="header-anchor" href="#pysrregressor-parameters" aria-label="Permalink to &quot;PySRRegressor Parameters&quot;">​</a></h2><h3 id="the-algorithm" tabindex="-1">The Algorithm <a class="header-anchor" href="#the-algorithm" aria-label="Permalink to &quot;The Algorithm&quot;">​</a></h3><h4 id="creating-the-search-space" tabindex="-1">Creating the Search Space <a class="header-anchor" href="#creating-the-search-space" aria-label="Permalink to &quot;Creating the Search Space&quot;">​</a></h4><ul><li><p><strong><code>binary_operators</code></strong></p><p>List of strings for binary operators used in the search. See the <a href="https://ai.damtp.cam.ac.uk/PySR/operators/" target="_blank" rel="noreferrer">operators page</a> for more details.</p><p><em>Default:</em> <code>[&quot;+&quot;, &quot;-&quot;, &quot;*&quot;, &quot;/&quot;]</code></p></li><li><p><strong><code>unary_operators</code></strong></p><p>Operators which only take a single scalar as input. For example, <code>&quot;cos&quot;</code> or <code>&quot;exp&quot;</code>.</p><p><em>Default:</em> <code>None</code></p></li><li><p><strong><code>maxsize</code></strong></p><p>Max complexity of an equation.</p><p><em>Default:</em> <code>20</code></p></li><li><p><strong><code>maxdepth</code></strong></p><p>Max depth of an equation. You can use both <code>maxsize</code> and <code>maxdepth</code>. <code>maxdepth</code> is by default not used.</p><p><em>Default:</em> <code>None</code></p></li></ul><h4 id="setting-the-search-size" tabindex="-1">Setting the Search Size <a class="header-anchor" href="#setting-the-search-size" aria-label="Permalink to &quot;Setting the Search Size&quot;">​</a></h4><ul><li><p><strong><code>niterations</code></strong></p><p>Number of iterations of the algorithm to run. The best equations are printed and migrate between populations at the end of each iteration.</p><p><em>Default:</em> <code>40</code></p></li><li><p><strong><code>populations</code></strong></p><p>Number of populations running.</p><p><em>Default:</em> <code>15</code></p></li><li><p><strong><code>population_size</code></strong></p><p>Number of individuals in each population.</p><p><em>Default:</em> <code>33</code></p></li><li><p><strong><code>ncycles_per_iteration</code></strong></p><p>Number of total mutations to run, per 10 samples of the population, per iteration.</p><p><em>Default:</em> <code>550</code></p></li></ul><h4 id="the-objective" tabindex="-1">The Objective <a class="header-anchor" href="#the-objective" aria-label="Permalink to &quot;The Objective&quot;">​</a></h4><ul><li><p><strong><code>elementwise_loss</code></strong></p><p>String of Julia code specifying an elementwise loss function. Can either be a loss from LossFunctions.jl, or your own loss written as a function. Examples of custom written losses include: <code>myloss(x, y) = abs(x-y)</code> for non-weighted, or <code>myloss(x, y, w) = w*abs(x-y)</code> for weighted. The included losses include: Regression: <code>LPDistLoss{P}()</code>, <code>L1DistLoss()</code>, <code>L2DistLoss()</code> (mean square), <code>LogitDistLoss()</code>, <code>HuberLoss(d)</code>, <code>L1EpsilonInsLoss(ϵ)</code>, <code>L2EpsilonInsLoss(ϵ)</code>, <code>PeriodicLoss(c)</code>, <code>QuantileLoss(τ)</code>. Classification: <code>ZeroOneLoss()</code>, <code>PerceptronLoss()</code>, <code>L1HingeLoss()</code>, <code>SmoothedL1HingeLoss(γ)</code>, <code>ModifiedHuberLoss()</code>, <code>L2MarginLoss()</code>, <code>ExpLoss()</code>, <code>SigmoidLoss()</code>, <code>DWDMarginLoss(q)</code>.</p><p><em>Default:</em> <code>&quot;L2DistLoss()&quot;</code></p></li><li><p><strong><code>loss_function</code></strong></p><p>Alternatively, you can specify the full objective function as a snippet of Julia code, including any sort of custom evaluation (including symbolic manipulations beforehand), and any sort of loss function or regularizations. The default <code>loss_function</code> used in SymbolicRegression.jl is roughly equal to:</p><div class="language-julia vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang">julia</span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span style="--shiki-light:#D73A49;--shiki-dark:#F97583;">function</span><span style="--shiki-light:#6F42C1;--shiki-dark:#B392F0;"> eval_loss</span><span style="--shiki-light:#24292E;--shiki-dark:#E1E4E8;">(tree, dataset</span><span style="--shiki-light:#D73A49;--shiki-dark:#F97583;">::</span><span style="--shiki-light:#005CC5;--shiki-dark:#79B8FF;">Dataset{T,L}</span><span style="--shiki-light:#24292E;--shiki-dark:#E1E4E8;">, options)</span><span style="--shiki-light:#D73A49;--shiki-dark:#F97583;">::</span><span style="--shiki-light:#005CC5;--shiki-dark:#79B8FF;">L</span><span style="--shiki-light:#D73A49;--shiki-dark:#F97583;"> where</span><span style="--shiki-light:#24292E;--shiki-dark:#E1E4E8;"> {T,L}</span></span>
<span class="line"><span style="--shiki-light:#24292E;--shiki-dark:#E1E4E8;">    prediction, flag </span><span style="--shiki-light:#D73A49;--shiki-dark:#F97583;">=</span><span style="--shiki-light:#005CC5;--shiki-dark:#79B8FF;"> eval_tree_array</span><span style="--shiki-light:#24292E;--shiki-dark:#E1E4E8;">(tree, dataset</span><span style="--shiki-light:#D73A49;--shiki-dark:#F97583;">.</span><span style="--shiki-light:#24292E;--shiki-dark:#E1E4E8;">X, options)</span></span>
<span class="line"><span style="--shiki-light:#D73A49;--shiki-dark:#F97583;">    if</span><span style="--shiki-light:#D73A49;--shiki-dark:#F97583;"> !</span><span style="--shiki-light:#24292E;--shiki-dark:#E1E4E8;">flag</span></span>
<span class="line"><span style="--shiki-light:#D73A49;--shiki-dark:#F97583;">        return</span><span style="--shiki-light:#005CC5;--shiki-dark:#79B8FF;"> L</span><span style="--shiki-light:#24292E;--shiki-dark:#E1E4E8;">(</span><span style="--shiki-light:#005CC5;--shiki-dark:#79B8FF;">Inf</span><span style="--shiki-light:#24292E;--shiki-dark:#E1E4E8;">)</span></span>
<span class="line"><span style="--shiki-light:#D73A49;--shiki-dark:#F97583;">    end</span></span>
<span class="line"><span style="--shiki-light:#D73A49;--shiki-dark:#F97583;">    return</span><span style="--shiki-light:#005CC5;--shiki-dark:#79B8FF;"> sum</span><span style="--shiki-light:#24292E;--shiki-dark:#E1E4E8;">((prediction </span><span style="--shiki-light:#D73A49;--shiki-dark:#F97583;">.-</span><span style="--shiki-light:#24292E;--shiki-dark:#E1E4E8;"> dataset</span><span style="--shiki-light:#D73A49;--shiki-dark:#F97583;">.</span><span style="--shiki-light:#24292E;--shiki-dark:#E1E4E8;">y) </span><span style="--shiki-light:#D73A49;--shiki-dark:#F97583;">.^</span><span style="--shiki-light:#005CC5;--shiki-dark:#79B8FF;"> 2</span><span style="--shiki-light:#24292E;--shiki-dark:#E1E4E8;">) </span><span style="--shiki-light:#D73A49;--shiki-dark:#F97583;">/</span><span style="--shiki-light:#24292E;--shiki-dark:#E1E4E8;"> dataset</span><span style="--shiki-light:#D73A49;--shiki-dark:#F97583;">.</span><span style="--shiki-light:#24292E;--shiki-dark:#E1E4E8;">n</span></span>
<span class="line"><span style="--shiki-light:#D73A49;--shiki-dark:#F97583;">end</span></span></code></pre></div><p>where the example elementwise loss is mean-squared error. You may pass a function with the same arguments as this (note that the name of the function doesn&#39;t matter). Here, both <code>prediction</code> and <code>dataset.y</code> are 1D arrays of length <code>dataset.n</code>. If using <code>batching</code>, then you should add an <code>idx</code> argument to the function, which is <code>nothing</code> for non-batched, and a 1D array of indices for batched.</p><p><em>Default:</em> <code>None</code></p></li><li><p><strong><code>model_selection</code></strong></p><p>Model selection criterion when selecting a final expression from the list of best expression at each complexity. Can be <code>&#39;accuracy&#39;</code>, <code>&#39;best&#39;</code>, or <code>&#39;score&#39;</code>. <code>&#39;accuracy&#39;</code> selects the candidate model with the lowest loss (highest accuracy). <code>&#39;score&#39;</code> selects the candidate model with the highest score. Score is defined as the negated derivative of the log-loss with respect to complexity - if an expression has a much better loss at a slightly higher complexity, it is preferred. <code>&#39;best&#39;</code> selects the candidate model with the highest score among expressions with a loss better than at least 1.5x the most accurate model.</p><p><em>Default:</em> <code>&#39;best&#39;</code></p></li><li><p><strong><code>dimensional_constraint_penalty</code></strong></p><p>Additive penalty for if dimensional analysis of an expression fails. By default, this is <code>1000.0</code>.</p></li></ul><h4 id="working-with-complexities" tabindex="-1">Working with Complexities <a class="header-anchor" href="#working-with-complexities" aria-label="Permalink to &quot;Working with Complexities&quot;">​</a></h4><ul><li><p><strong><code>parsimony</code></strong></p><p>Multiplicative factor for how much to punish complexity.</p><p><em>Default:</em> <code>0.0032</code></p></li><li><p><strong><code>constraints</code></strong></p><p>Dictionary of int (unary) or 2-tuples (binary), this enforces maxsize constraints on the individual arguments of operators. E.g., <code>&#39;pow&#39;: (-1, 1)</code> says that power laws can have any complexity left argument, but only 1 complexity in the right argument. Use this to force more interpretable solutions.</p><p><em>Default:</em> <code>None</code></p></li><li><p><strong><code>nested_constraints</code></strong></p><p>Specifies how many times a combination of operators can be nested. For example, <code>{&quot;sin&quot;: {&quot;cos&quot;: 0}}, &quot;cos&quot;: {&quot;cos&quot;: 2}}</code> specifies that <code>cos</code> may never appear within a <code>sin</code>, but <code>sin</code> can be nested with itself an unlimited number of times. The second term specifies that <code>cos</code> can be nested up to 2 times within a <code>cos</code>, so that <code>cos(cos(cos(x)))</code> is allowed (as well as any combination of <code>+</code> or <code>-</code> within it), but <code>cos(cos(cos(cos(x))))</code> is not allowed. When an operator is not specified, it is assumed that it can be nested an unlimited number of times. This requires that there is no operator which is used both in the unary operators and the binary operators (e.g., <code>-</code> could be both subtract, and negation). For binary operators, you only need to provide a single number: both arguments are treated the same way, and the max of each argument is constrained.</p><p><em>Default:</em> <code>None</code></p></li><li><p><strong><code>complexity_of_operators</code></strong></p><p>If you would like to use a complexity other than 1 for an operator, specify the complexity here. For example, <code>{&quot;sin&quot;: 2, &quot;+&quot;: 1}</code> would give a complexity of 2 for each use of the <code>sin</code> operator, and a complexity of 1 for each use of the <code>+</code> operator (which is the default). You may specify real numbers for a complexity, and the total complexity of a tree will be rounded to the nearest integer after computing.</p><p><em>Default:</em> <code>None</code></p></li><li><p><strong><code>complexity_of_constants</code></strong></p><p>Complexity of constants.</p><p><em>Default:</em> <code>1</code></p></li><li><p><strong><code>complexity_of_variables</code></strong></p><p>Complexity of variables.</p><p><em>Default:</em> <code>1</code></p></li><li><p><strong><code>warmup_maxsize_by</code></strong></p><p>Whether to slowly increase max size from a small number up to the maxsize (if greater than 0). If greater than 0, says the fraction of training time at which the current maxsize will reach the user-passed maxsize.</p><p><em>Default:</em> <code>0.0</code></p></li><li><p><strong><code>use_frequency</code></strong></p><p>Whether to measure the frequency of complexities, and use that instead of parsimony to explore equation space. Will naturally find equations of all complexities.</p><p><em>Default:</em> <code>True</code></p></li><li><p><strong><code>use_frequency_in_tournament</code></strong></p><p>Whether to use the frequency mentioned above in the tournament, rather than just the simulated annealing.</p><p><em>Default:</em> <code>True</code></p></li><li><p><strong><code>adaptive_parsimony_scaling</code></strong></p><p>If the adaptive parsimony strategy (<code>use_frequency</code> and <code>use_frequency_in_tournament</code>), this is how much to (exponentially) weight the contribution. If you find that the search is only optimizing the most complex expressions while the simpler expressions remain stagnant, you should increase this value.</p><p><em>Default:</em> <code>20.0</code></p></li><li><p><strong><code>should_simplify</code></strong></p><p>Whether to use algebraic simplification in the search. Note that only a few simple rules are implemented.</p><p><em>Default:</em> <code>True</code></p></li></ul><h4 id="mutations" tabindex="-1">Mutations <a class="header-anchor" href="#mutations" aria-label="Permalink to &quot;Mutations&quot;">​</a></h4><ul><li><p><strong><code>weight_add_node</code></strong></p><p>Relative likelihood for mutation to add a node.</p><p><em>Default:</em> <code>0.79</code></p></li><li><p><strong><code>weight_insert_node</code></strong></p><p>Relative likelihood for mutation to insert a node.</p><p><em>Default:</em> <code>5.1</code></p></li><li><p><strong><code>weight_delete_node</code></strong></p><p>Relative likelihood for mutation to delete a node.</p><p><em>Default:</em> <code>1.7</code></p></li><li><p><strong><code>weight_do_nothing</code></strong></p><p>Relative likelihood for mutation to leave the individual.</p><p><em>Default:</em> <code>0.21</code></p></li><li><p><strong><code>weight_mutate_constant</code></strong></p><p>Relative likelihood for mutation to change the constant slightly in a random direction.</p><p><em>Default:</em> <code>0.048</code></p></li><li><p><strong><code>weight_mutate_operator</code></strong></p><p>Relative likelihood for mutation to swap an operator.</p><p><em>Default:</em> <code>0.47</code></p></li><li><p><strong><code>weight_swap_operands</code></strong></p><p>Relative likehood for swapping operands in binary operators.</p><p><em>Default:</em> <code>0.0</code></p></li><li><p><strong><code>weight_randomize</code></strong></p><p>Relative likelihood for mutation to completely delete and then randomly generate the equation</p><p><em>Default:</em> <code>0.00023</code></p></li><li><p><strong><code>weight_simplify</code></strong></p><p>Relative likelihood for mutation to simplify constant parts by evaluation</p><p><em>Default:</em> <code>0.0020</code></p></li><li><p><strong><code>weight_optimize</code></strong></p><p>Constant optimization can also be performed as a mutation, in addition to the normal strategy controlled by <code>optimize_probability</code> which happens every iteration. Using it as a mutation is useful if you want to use a large <code>ncycles_periteration</code>, and may not optimize very often.</p><p><em>Default:</em> <code>0.0</code></p></li><li><p><strong><code>crossover_probability</code></strong></p><p>Absolute probability of crossover-type genetic operation, instead of a mutation.</p><p><em>Default:</em> <code>0.066</code></p></li><li><p><strong><code>annealing</code></strong></p><p>Whether to use annealing.</p><p><em>Default:</em> <code>False</code></p></li><li><p><strong><code>alpha</code></strong></p><p>Initial temperature for simulated annealing (requires <code>annealing</code> to be <code>True</code>).</p><p><em>Default:</em> <code>0.1</code></p></li><li><p><strong><code>perturbation_factor</code></strong></p><p>Constants are perturbed by a max factor of (perturbation_factor*T + 1). Either multiplied by this or divided by this.</p><p><em>Default:</em> <code>0.076</code></p></li><li><p><strong><code>skip_mutation_failures</code></strong></p><p>Whether to skip mutation and crossover failures, rather than simply re-sampling the current member.</p><p><em>Default:</em> <code>True</code></p></li></ul><h4 id="tournament-selection" tabindex="-1">Tournament Selection <a class="header-anchor" href="#tournament-selection" aria-label="Permalink to &quot;Tournament Selection&quot;">​</a></h4><ul><li><p><strong><code>tournament_selection_n</code></strong></p><p>Number of expressions to consider in each tournament.</p><p><em>Default:</em> <code>10</code></p></li><li><p><strong><code>tournament_selection_p</code></strong></p><p>Probability of selecting the best expression in each tournament. The probability will decay as p*(1-p)^n for other expressions, sorted by loss.</p><p><em>Default:</em> <code>0.86</code></p></li></ul><h4 id="constant-optimization" tabindex="-1">Constant Optimization <a class="header-anchor" href="#constant-optimization" aria-label="Permalink to &quot;Constant Optimization&quot;">​</a></h4><ul><li><p><strong><code>optimizer_algorithm</code></strong></p><p>Optimization scheme to use for optimizing constants. Can currently be <code>NelderMead</code> or <code>BFGS</code>.</p><p><em>Default:</em> <code>&quot;BFGS&quot;</code></p></li><li><p><strong><code>optimizer_nrestarts</code></strong></p><p>Number of time to restart the constants optimization process with different initial conditions.</p><p><em>Default:</em> <code>2</code></p></li><li><p><strong><code>optimize_probability</code></strong></p><p>Probability of optimizing the constants during a single iteration of the evolutionary algorithm.</p><p><em>Default:</em> <code>0.14</code></p></li><li><p><strong><code>optimizer_iterations</code></strong></p><p>Number of iterations that the constants optimizer can take.</p><p><em>Default:</em> <code>8</code></p></li><li><p><strong><code>should_optimize_constants</code></strong></p><p>Whether to numerically optimize constants (Nelder-Mead/Newton) at the end of each iteration.</p><p><em>Default:</em> <code>True</code></p></li></ul><h4 id="migration-between-populations" tabindex="-1">Migration between Populations <a class="header-anchor" href="#migration-between-populations" aria-label="Permalink to &quot;Migration between Populations&quot;">​</a></h4><ul><li><p><strong><code>fraction_replaced</code></strong></p><p>How much of population to replace with migrating equations from other populations.</p><p><em>Default:</em> <code>0.000364</code></p></li><li><p><strong><code>fraction_replaced_hof</code></strong></p><p>How much of population to replace with migrating equations from hall of fame.</p><p><em>Default:</em> <code>0.035</code></p></li><li><p><strong><code>migration</code></strong></p><p>Whether to migrate.</p><p><em>Default:</em> <code>True</code></p></li><li><p><strong><code>hof_migration</code></strong></p><p>Whether to have the hall of fame migrate.</p><p><em>Default:</em> <code>True</code></p></li><li><p><strong><code>topn</code></strong></p><p>How many top individuals migrate from each population.</p><p><em>Default:</em> <code>12</code></p></li></ul><h3 id="data-preprocessing" tabindex="-1">Data Preprocessing <a class="header-anchor" href="#data-preprocessing" aria-label="Permalink to &quot;Data Preprocessing&quot;">​</a></h3><ul><li><p><strong><code>denoise</code></strong></p><p>Whether to use a Gaussian Process to denoise the data before inputting to PySR. Can help PySR fit noisy data.</p><p><em>Default:</em> <code>False</code></p></li><li><p><strong><code>select_k_features</code></strong></p><p>Whether to run feature selection in Python using random forests, before passing to the symbolic regression code. None means no feature selection; an int means select that many features.</p><p><em>Default:</em> <code>None</code></p></li></ul><h3 id="stopping-criteria" tabindex="-1">Stopping Criteria <a class="header-anchor" href="#stopping-criteria" aria-label="Permalink to &quot;Stopping Criteria&quot;">​</a></h3><ul><li><p><strong><code>max_evals</code></strong></p><p>Limits the total number of evaluations of expressions to this number.</p><p><em>Default:</em> <code>None</code></p></li><li><p><strong><code>timeout_in_seconds</code></strong></p><p>Make the search return early once this many seconds have passed.</p><p><em>Default:</em> <code>None</code></p></li><li><p><strong><code>early_stop_condition</code></strong></p><p>Stop the search early if this loss is reached. You may also pass a string containing a Julia function which takes a loss and complexity as input, for example: <code>&quot;f(loss, complexity) = (loss &lt; 0.1) &amp;&amp; (complexity &lt; 10)&quot;</code>.</p><p><em>Default:</em> <code>None</code></p></li></ul><h3 id="performance-and-parallelization" tabindex="-1">Performance and Parallelization <a class="header-anchor" href="#performance-and-parallelization" aria-label="Permalink to &quot;Performance and Parallelization&quot;">​</a></h3><ul><li><p><strong><code>procs</code></strong></p><p>Number of processes (=number of populations running).</p><p><em>Default:</em> <code>cpu_count()</code></p></li><li><p><strong><code>multithreading</code></strong></p><p>Use multithreading instead of distributed backend. Using procs=0 will turn off both.</p><p><em>Default:</em> <code>True</code></p></li><li><p><strong><code>cluster_manager</code></strong></p><p>For distributed computing, this sets the job queue system. Set to one of &quot;slurm&quot;, &quot;pbs&quot;, &quot;lsf&quot;, &quot;sge&quot;, &quot;qrsh&quot;, &quot;scyld&quot;, or &quot;htc&quot;. If set to one of these, PySR will run in distributed mode, and use <code>procs</code> to figure out how many processes to launch.</p><p><em>Default:</em> <code>None</code></p></li><li><p><strong><code>heap_size_hint_in_bytes</code></strong></p><p>For multiprocessing, this sets the <code>--heap-size-hint</code> parameter for new Julia processes. This can be configured when using multi-node distributed compute, to give a hint to each process about how much memory they can use before aggressive garbage collection.</p></li><li><p><strong><code>batching</code></strong></p><p>Whether to compare population members on small batches during evolution. Still uses full dataset for comparing against hall of fame.</p><p><em>Default:</em> <code>False</code></p></li><li><p><strong><code>batch_size</code></strong></p><p>The amount of data to use if doing batching.</p><p><em>Default:</em> <code>50</code></p></li><li><p><strong><code>precision</code></strong></p><p>What precision to use for the data. By default this is <code>32</code> (float32), but you can select <code>64</code> or <code>16</code> as well, giving you 64 or 16 bits of floating point precision, respectively. If you pass complex data, the corresponding complex precision will be used (i.e., <code>64</code> for complex128, <code>32</code> for complex64).</p><p><em>Default:</em> <code>32</code></p></li><li><p><strong><code>fast_cycle</code></strong></p><p>Batch over population subsamples. This is a slightly different algorithm than regularized evolution, but does cycles 15% faster. May be algorithmically less efficient.</p><p><em>Default:</em> <code>False</code></p></li><li><p><strong><code>turbo</code></strong></p><p>(Experimental) Whether to use LoopVectorization.jl to speed up the search evaluation. Certain operators may not be supported. Does not support 16-bit precision floats.</p><p><em>Default:</em> <code>False</code></p></li><li><p><strong><code>enable_autodiff</code></strong></p><p>Whether to create derivative versions of operators for automatic differentiation. This is only necessary if you wish to compute the gradients of an expression within a custom loss function.</p><p><em>Default:</em> <code>False</code></p></li></ul><h3 id="determinism" tabindex="-1">Determinism <a class="header-anchor" href="#determinism" aria-label="Permalink to &quot;Determinism&quot;">​</a></h3><ul><li><p><strong><code>random_state</code></strong></p><p>Pass an int for reproducible results across multiple function calls. See :term:<code>Glossary &lt;random_state&gt;</code>.</p><p><em>Default:</em> <code>None</code></p></li><li><p><strong><code>deterministic</code></strong></p><p>Make a PySR search give the same result every run. To use this, you must turn off parallelism (with <code>procs</code>=0, <code>multithreading</code>=False), and set <code>random_state</code> to a fixed seed.</p><p><em>Default:</em> <code>False</code></p></li><li><p><strong><code>warm_start</code></strong></p><p>Tells fit to continue from where the last call to fit finished. If false, each call to fit will be fresh, overwriting previous results.</p><p><em>Default:</em> <code>False</code></p></li></ul><h3 id="monitoring" tabindex="-1">Monitoring <a class="header-anchor" href="#monitoring" aria-label="Permalink to &quot;Monitoring&quot;">​</a></h3><ul><li><p><strong><code>verbosity</code></strong></p><p>What verbosity level to use. 0 means minimal print statements.</p><p><em>Default:</em> <code>1</code></p></li><li><p><strong><code>update_verbosity</code></strong></p><p>What verbosity level to use for package updates. Will take value of <code>verbosity</code> if not given.</p><p><em>Default:</em> <code>None</code></p></li><li><p><strong><code>print_precision</code></strong></p><p>How many significant digits to print for floats.</p><p><em>Default:</em> <code>5</code></p></li><li><p><strong><code>progress</code></strong></p><p>Whether to use a progress bar instead of printing to stdout.</p><p><em>Default:</em> <code>True</code></p></li></ul><h3 id="environment" tabindex="-1">Environment <a class="header-anchor" href="#environment" aria-label="Permalink to &quot;Environment&quot;">​</a></h3><ul><li><p><strong><code>temp_equation_file</code></strong></p><p>Whether to put the hall of fame file in the temp directory. Deletion is then controlled with the <code>delete_tempfiles</code> parameter.</p><p><em>Default:</em> <code>False</code></p></li><li><p><strong><code>tempdir</code></strong></p><p>directory for the temporary files.</p><p><em>Default:</em> <code>None</code></p></li><li><p><strong><code>delete_tempfiles</code></strong></p><p>Whether to delete the temporary files after finishing.</p><p><em>Default:</em> <code>True</code></p></li><li><p><strong><code>update</code></strong></p><p>Whether to automatically update Julia packages when <code>fit</code> is called. You should make sure that PySR is up-to-date itself first, as the packaged Julia packages may not necessarily include all updated dependencies.</p><p><em>Default:</em> <code>False</code></p></li></ul><h3 id="exporting-the-results" tabindex="-1">Exporting the Results <a class="header-anchor" href="#exporting-the-results" aria-label="Permalink to &quot;Exporting the Results&quot;">​</a></h3><ul><li><p><strong><code>equation_file</code></strong></p><p>Where to save the files (.csv extension).</p><p><em>Default:</em> <code>None</code></p></li><li><p><strong><code>output_jax_format</code></strong></p><p>Whether to create a &#39;jax_format&#39; column in the output, containing jax-callable functions and the default parameters in a jax array.</p><p><em>Default:</em> <code>False</code></p></li><li><p><strong><code>output_torch_format</code></strong></p><p>Whether to create a &#39;torch_format&#39; column in the output, containing a torch module with trainable parameters.</p><p><em>Default:</em> <code>False</code></p></li><li><p><strong><code>extra_sympy_mappings</code></strong></p><p>Provides mappings between custom <code>binary_operators</code> or <code>unary_operators</code> defined in julia strings, to those same operators defined in sympy. E.G if <code>unary_operators=[&quot;inv(x)=1/x&quot;]</code>, then for the fitted model to be export to sympy, <code>extra_sympy_mappings</code> would be <code>{&quot;inv&quot;: lambda x: 1/x}</code>.</p><p><em>Default:</em> <code>None</code></p></li><li><p><strong><code>extra_torch_mappings</code></strong></p><p>The same as <code>extra_jax_mappings</code> but for model export to pytorch. Note that the dictionary keys should be callable pytorch expressions. For example: <code>extra_torch_mappings={sympy.sin: torch.sin}</code>.</p><p><em>Default:</em> <code>None</code></p></li><li><p><strong><code>extra_jax_mappings</code></strong></p><p>Similar to <code>extra_sympy_mappings</code> but for model export to jax. The dictionary maps sympy functions to jax functions. For example: <code>extra_jax_mappings={sympy.sin: &quot;jnp.sin&quot;}</code> maps the <code>sympy.sin</code> function to the equivalent jax expression <code>jnp.sin</code>.</p><p><em>Default:</em> <code>None</code></p></li></ul><h2 id="pysrregressor-functions" tabindex="-1">PySRRegressor Functions <a class="header-anchor" href="#pysrregressor-functions" aria-label="Permalink to &quot;PySRRegressor Functions&quot;">​</a></h2><p>::: pysr.PySRRegressor.fit options: show_root_heading: true heading_level: 3 show_root_full_path: false</p><p>::: pysr.PySRRegressor.predict options: show_root_heading: true heading_level: 3 show_root_full_path: false</p><p>::: pysr.PySRRegressor.from_file options: show_root_heading: true heading_level: 3 show_root_full_path: false</p><p>::: pysr.PySRRegressor.sympy options: show_root_heading: true heading_level: 3 show_root_full_path: false</p><p>::: pysr.PySRRegressor.latex options: show_root_heading: true heading_level: 3 show_root_full_path: false</p><p>::: pysr.PySRRegressor.pytorch options: show_root_heading: true heading_level: 3 show_root_full_path: false</p><p>::: pysr.PySRRegressor.jax options: show_root_heading: true heading_level: 3 show_root_full_path: false</p><p>::: pysr.PySRRegressor.latex_table options: show_root_heading: true heading_level: 3 show_root_full_path: false</p><p>::: pysr.PySRRegressor.refresh options: show_root_heading: true heading_level: 3 show_root_full_path: false</p>`,44)])])}const m=o(s,[["render",n]]);export{u as __pageData,m as default};
